import React, { Fragment } from "react";
import { Helmet } from "react-helmet";

const Home = () => (
  <Fragment>
    <Helmet>
      <title>Kviz</title>
    </Helmet>
    <div id="home">
      <section>
        <h1>Osnove Programiranja</h1>
        <div className="play-button-container">
          <ul>
            <li></li>
          </ul>
        </div>
      </section>
    </div>
  </Fragment>
);

export default Home;
